import React from 'react';
import Button from '@material-ui/core/Button';
import { green, purple } from '@material-ui/core/colors';
import './App.scss';


const Nav = () =>{
    const theme = createMuiTheme({
        palette: {
          primary: green,
        },
      });
return(
    <ul>
    <li><Button variant="contained" color="success.main">Primary</Button></li>
    <li><Button variant="contained" color="info.main">Primary</Button></li>
    <li></li>
    <li></li>    
    </ul>
    )
}
export default Nav;
